export default function BurgerConstructor (props) {
    return (
    <div className={clsx(styles.burgerContainer, 'mt-25')}>
        <ConstructorElement text={props.text} thumbnail={props.image} price={1} type={props.price}></ConstructorElement>
        <ConstructorElement text={props.text} thumbnail={props.image} price={1}></ConstructorElement>
        <ConstructorElement text={props.text} thumbnail={props.image} price={1}></ConstructorElement>
        <ConstructorElement text={props.text} thumbnail={props.image} price={1} type={'bottom'}></ConstructorElement>
    </div>
    )
}
